function getProjects(e){const s=`/nav?page=${e}`,n=document.getElementById("cards-container");"recent"===e?(document.getElementById("recents").classList.add("nav-active"),document.getElementById("favorites").classList.remove("nav-active"),document.getElementById("user").classList.remove("nav-active")):"starred"===e?(document.getElementById("favorites").classList.add("nav-active"),document.getElementById("recents").classList.remove("nav-active"),document.getElementById("user").classList.remove("nav-active")):(document.getElementById("user").classList.add("nav-active"),document.getElementById("recents").classList.remove("nav-active"),document.getElementById("favorites").classList.remove("nav-active")),$.ajax({type:"GET",url:s,success:function(e){if(n.innerHTML="",0===e.data.projects.length)return void(n.innerHTML='\n                <div class="no-projects">\n                    <p>No projects found</p>\n                </div>\n                ');console.log("*******",e);let s=0;e.data.projects.forEach((t=>{n.innerHTML+=cardContainer(t,e.data.favorites,e.data.time[s++]),console.log(n)}))},error:function(e){console.log(e)}})}const cardContainer=(e,s,n)=>`\n    <div  class="card-container animate__animated animate__fadeIn">\n        <div class="user-info">\n            <img src="${e.user.avatar}" alt="">\n            <p class="user-name">${e.user.name} </p>\n            <p class="day"> ${n} </p>\n        </div>\n\n        <div class="project-info">\n            <p onclick="window.location.href = '/issues/${e._id}/all'" class="title">${e.title} </p>\n            <p class="description">${e.description} </p>\n\n            <div class="card-footer">\n                <p class="type"><i class="fa-solid fa-circle"></i>${e.type} Application </p>\n                <p id="stars-count" class="stars"><i class="fa-regular fa-star"></i>${e.starsCount}</p>\n            </div>\n\n            ${s&&s.projects.includes(e._id)?`<div id="starred-${e._id}" onclick="removeFromFavorites('${e._id}')" class="star-button">\n                    <i class="fa-solid fa-star"></i>\n                    <p>Starred</p>\n                </div>`:`<div id="star-${e._id}" onclick="addToFavorites('${e._id}')" class="star-button">\n                    <i class="fa-regular fa-star"></i>\n                    <p>Star</p>\n                </div>\n            `}\n\n        </div>\n\n        <div class="issues">\n            <p>${e.issues.length} Issues</p>\n        </div>\n    </div>\n    `;